(function() {
  var guess, randStr, randText;

  randStr = function() {
    return Math.random().toString(36).substring(7);
  };

  randText = function(length) {
    var start;
    start = randStr();
    while (start.length < length) {
      start += randStr();
    }
    return start.substring(0, length);
  };

  guess = function($container) {
    var count, len, t, text;
    count = 10;
    text = $container.text();
    len = text.length;
    return t = setInterval(function() {
      $container.text(randText(len));
      count--;
      if (count === 0) {
        clearInterval(t);
        return $container.text(text);
      }
    }, 50);
  };

  $(function() {
    $('pre').css('background-color', 'black');
    $('pre code').addClass('prettyprint');
    return prettyPrint();
  });

}).call(this);
